import React from 'react'
import styled from 'styled-components'

const Input_ = styled.input(props => ({
  outline: 'none',
  border: 'none',
  width: 50,
  padding: '0 10px',
  textAlign: 'center'
}))

export default props => {
  return <Input_ {...props} />
}
